import logo from './logo.svg';
import './App.css';
import {GoogleLogin} from 'react-google-login'
import axios from 'axios'
import { useState } from 'react';
function App() {

  const responseGoogle = response => {
    console.log(response);
    const {code} = response
    axios.post('/api/create-tokens',{code})
    .then(response => {
      console.log(response.data)
    })
    .catch(error => {
      console.log(error.message)
    })

  }

  const responseError = error => {
    console.log(error);
  }

  const handleSubmit = (e) => {
    e.preventDefault()
  }

  const [summary, setSummary] = useState('')
  const [description, setDescription] = useState('')
  const [location, setLocation] = useState('')
  const [startDateTime, setStartDateTime] = useState('')
  const [endDateTime, setEndDateTime] = useState('')

  return (
  <div>
    <div className="App">
      <h1>Google Calendar API</h1>
    </div>
    <div>
      <GoogleLogin clientId='381577986964-scht8fd1d758n3sv5u6jmga46t5h2gfi.apps.googleusercontent.com'
      buttonText='Sign in & Authorize Calendar'
      onSuccess={responseGoogle}
      onFailure={responseError}
      cookiePolicy={'single_host_origin'}
      responseType='code'
      accessType='offline'
      scope='openid email profile https://www.googleapis.com/auth/calendar'/>
    </div>
    <div>
      <form onSubmi={handleSubmit}>
        <label htmlFor='summary'>Summary</label>
        <br/>
        <input type='text' id="summary" value={summary} onChange={e => setSummary(e.target.value)}/>
        <br/>
        <label htmlFor='description'>Description</label>
        <br/>
        <input type='text' id="description" value={description} onChange={e => setSummary(e.target.value)}/>
        <br/>

      </form>
    </div>
  </div>
  );
}

export default App;
